import React from 'react';

class NavigationBar extends React.PureComponent{
  render(){
    return(
      <ul className='pure-menu-list'>
        <li className='pure-menu-item'>
          <a href='#' className='redirects'>NetFlix</a>
        </li>
      </ul>
  );
  }
}
export default NavigationBar;
